  function handleSubmit(){
    console.log('submit');
  }
let formik = useFormik({
  initialValues:{
    details:"",
    phone:"",
    city:""
  },
  onSubmit:handleSubmit
})
  return ( <>
    <div className="container">
<form onSubmit={formik.handleSubmit}>
  <label htmlFor="details"></label>
  <input type="text"  className='form-control '/>
</form>
    </div>    
   
    <h1>Address</h1>
    </>
  )
}
